import React from "react";

const Footer = () => {
  return (
    <div id="footer">
      <div class="marquee" aria-hidden="true">
        <div>
          Let's Have Fun → JavaScript is cool → I Love JavaScript → &#169; 2023
          Ching Yang &#169;
        </div>
      </div>
    </div>
  );
};

export default Footer;
